import react from "react";
import ExpenseForm from "./ExpenseForm";
import "./NewExpense.css";

function NewExpense(props) {
  const onSaveExpenseHandler = (enteredExpenseData) => {
    const expenseData = {
      ...enteredExpenseData,
      id: Math.random().toString(),
    };
    props.addExpenseData(expenseData);
  };

  const changeHandler = () => {
    display = (
      <ExpenseForm onSaveExpenseData={onSaveExpenseHandler}></ExpenseForm>
    );
  };

  let display = <button onClick={changeHandler}>Add New Expense</button>;

  return <div className="new-expense"></div>;
}

export default NewExpense;
